import React, { Component } from "react";

const NavBar = () => {
  return (
    <nav className="navbar navbar-light bg-light">
      <a className="navar-brand" href="#">
        Navbar
        <span className="badge badge-pill badge-secondary m-2">
          {this.props.totalCounters}
        </span>
      </a>
    </nav>
  );
};

export default NavBar;
